            "cgu.h1.3": "3. Utilisation de l'API",
            "cgu.p.1": "Bienvenue sur data.primals.net (le « Site ). Ce site est exploité par Primals.net (le « Fournisseur »). En utilisant notre service d'hébergement de données, vous acceptez de vous conformer aux présentes Conditions Générales d'Utilisation (CGU). Si vous n'acceptez pas ces conditions, veuillez ne pas utiliser notre service.",
