            "cgu.p.4": "En utilisant notre service, vous acceptez de :\n\nRespecter les limitations techniques mentionnées ci-dessus.\nNe pas utiliser notre service pour des activités illégales ou non autorisées.\nNe pas tenter de contourner ou de désactiver les mesures de sécurité de notre service.\nNe pas partager vos identifiants de connexion avec des tiers.",
            "cgu.h1.5": "5. Propriété Intellectuelle",
