            "cgu.p.1": "Welcome to data.primals.net (the \"Site\"). This site is operated by Primals.net (the \"Provider\"). By using our data hosting service, you agree to comply with these Terms of Use (TOU). If you do not agree to these terms, please do not use our service.",
