            "cgu.p.2": "data.primals.net offers a data hosting service including a management user interface (UI) and an API for developers. This service allows users to store, manage, and access their data securely and efficiently.",
            "cgu.h1.3": "3. Use of the API",
            "cgu.p.3": "Use of our API is subject to the following limitations:",
            "cgu.p.3.1": "Maximum number of models per user: {{constant}} models.",
            "cgu.p.3.2": "Maximum amount of data per model and per user: {{constant}} records.",
            "cgu.p.3.3": "Maximum length of character strings: {{constant}} characters.",
            "cgu.p.3.4": "Maximum length of passwords: {{constant}} characters.",
            "cgu.p.3.5": "Maximum length of rich texts: {{constant}} characters.",
            "cgu.p.3.6": "Maximum amount of data per query: {{constant}} records.",
            "cgu.p.3.7": "Maximum amount of data per publication: {{constant}} records.",
            "cgu.p.3.8": "Maximum number of relationships per data item: {{constant}} relationships.",
            "cgu.p.3.9": "Data rate: {{constant}} kbps.",
            "cgu.h1.4": "4. User Responsibilities",
            "cgu.p.4": "By using our service, you agree to:\n\nRespect the technical limitations mentioned above.\nDo not use our service for illegal or unauthorized activities.\nDo not attempt to circumvent or disable the security measures of our service.\nDo not share your login credentials with third parties.",
            "cgu.h1.5": "5. Intellectual Property",
            "cgu.p.5": "All content on the Site, including text, images, graphics, logos, icons, and software, is the property of the Provider or its licensors and is protected by copyright laws. You may not use, reproduce, distribute, or modify this content without our prior written permission.",
            "cgu.h1.6": "6. Confidentiality and Data Protection",
            "cgu.p.6": "We are committed to protecting your personal data in accordance with our Privacy Policy. You are responsible for the security of your login credentials and the confidentiality of your data.",
            "cgu.h1.7": "7. Limitation of Liability",
            "cgu.p.7": "The Provider will not be liable for any indirect, incidental, special, or consequential damages resulting from the use or inability to use our service, even if we have been advised of the possibility of such damages.",
            "cgu.h1.8": "8. Modifications to the TOU",
            "cgu.p.8": "We reserve the right to modify these TOU at any time. Modifications will be posted on the Site and will take effect immediately. It is your responsibility to regularly consult these TOU to keep informed of any changes.",
            "cgu.h1.9": "9. Termination",
            "cgu.p.9": "We reserve the right to terminate your access to our service at any time, with or without cause, and without notice. You may also terminate your account at any time by following the instructions available on the Site.",
            "cgu.h1.10": "10. Applicable Law",
            "cgu.p.10": "These TOU are governed by the laws in force in France. Any dispute arising out of or in connection with these TOU will be submitted to the exclusive jurisdiction of the competent courts of that country.",
