            "cgu.h1": "Condiciones Generales de Uso (CGU)",
            "cgu.h1.1": "1. Introducción",
            "cgu.p.1": "Bienvenido a data.primals.net (el \"Sitio\"). Este sitio es operado por Primals.net (el \"Proveedor\"). Al utilizar nuestro servicio de alojamiento de datos, usted acepta cumplir con estas Condiciones Generales de Uso (CGU). Si no las acepta, le rogamos que no utilice nuestro servicio.",
            "cgu.h1.2": "2. Descripción del Servicio",
            "cgu.p.2": "data.primals.net ofrece un servicio de alojamiento de datos que incluye una interfaz de usuario (UI) de gestión y una API para desarrolladores. Este servicio permite a los usuarios almacenar, gestionar y acceder a sus datos de forma segura y eficiente.",
            "cgu.h1.3": "3. Uso de la API",
            "cgu.p.3": "El uso de nuestra API está sujeto a las siguientes limitaciones:",
            "cgu.p.3.1": "Número máximo de modelos por usuario: {{constant}} modelos.",
            "cgu.p.3.2": "Cantidad máxima de datos por modelo y por usuario: {{constant}} registros.",
            "cgu.p.3.3": "Longitud máxima de las cadenas de caracteres: {{constant}} caracteres.",
            "cgu.p.3.4": "Longitud máxima de la contraseña: {{constant}} caracteres.",
            "cgu.p.3.5": "Longitud máxima de los textos enriquecidos: {{constant}} caracteres.",
            "cgu.p.3.6": "Cantidad máxima de datos por consulta: {{constant}} registros.",
            "cgu.p.3.7": "Cantidad máxima de datos por publicación: {{constant}} registros.",
            "cgu.p.3.8": "Número máximo de relaciones por dato: {{constante}} relaciones.",
            "cgu.p.3.9": "Velocidad de datos: {{constante}} kb/s.",
            "cgu.h1.4": "4. Responsabilidades del usuario",
            "cgu.p.4": "Al usar nuestro servicio, usted acepta:\n\nRespetar las limitaciones técnicas mencionadas anteriormente.\nNo utilizar nuestro servicio para actividades ilegales o no autorizadas.\nNo intentar eludir ni desactivar las medidas de seguridad de nuestro servicio.\nNo compartir sus credenciales de inicio de sesión con otros niveles.",
            "cgu.h1.5": "5. Propiedad intelectual",
            "cgu.p.5": "Todo el contenido del Sitio, incluyendo texto, imágenes, gráficos, logotipos, iconos y software, es propiedad del Editor o de sus licenciantes y está protegido por las leyes de derechos de autor. No puede usar, reproducir, distribuir ni modificar este contenido sin nuestra autorización previa por escrito.",
            "cgu.h1.6": "6. Confidencialidad y protección de la información",
            "cgu.p.6": "Nos comprometemos a proteger sus datos personales de acuerdo con nuestra Política de Privacidad. Usted es responsable de la seguridad de sus datos de acceso y de la confidencialidad de sus datos.",
            "cgu.h1.7": "7. Limitación de responsabilidad",
            "cgu.p.7": "El Proveedor no será responsable de daños indirectos, incidentales, especiales o consecuentes derivados del uso o la imposibilidad de usar nuestro servicio, incluso si se nos informó de la posibilidad de dichos daños.",
            "cgu.h1.8": "8. Modificaciones a los Términos y Condiciones",
            "cgu.p.8": "Nos reservamos el derecho a modificar estas CGC en cualquier momento. Cualquier modificación se publicará en el Sitio y entrará en vigor de inmediato. Es su responsabilidad consultar atentamente estas CGC para mantenerse informado de cualquier cambio.",
            "cgu.h1.9": "9. Resiliencia",
            "cgu.p.9": "Nos reservamos el derecho de cancelar su acceso a nuestro servicio en cualquier momento, con o sin motivo, y sin previo aviso. También puede cancelar su cuenta en cualquier momento siguiendo las instrucciones disponibles en el Sitio.",
            "cgu.h1.10": "10. Leyes aplicables",
            "cgu.p.10": "Las presentes CGC se rigen por la legislación vigente en Francia. Cualquier controversia derivada de o relacionada con las presentes CGC se someterá a la jurisdicción exclusiva de los tribunales competentes de dicho país.",
            "seo.title": "¿Necesitas una solución API potente y segura, sin gastar una fortuna? ¡Descubre data.primals.net!",
