            "cgu.h1": "Termos e Condições Gerais de Uso (TCGU)",
            "cgu.h1.1": "1. Introdução",
            "cgu.p.1": "Bem-vindo ao data.primals.net (o \"Site\"). Este site é operado pela Primals.net (o \"Fornecedor\"). Ao utilizar o nosso serviço de hospedagem de dados, você concorda em cumprir estes Termos e Condições Gerais de Uso (TCGU). Se você não concordar com estes termos, por favor, não utilize o nosso serviço.",
            "cgu.h1.2": "2. Descrio Serviço",
            "cgu.p.2": "data.primals.net oferece um serviço de hospedagem de dados que inclui uma interface de usuário (UI) de gestão e uma API para desenvolvedores. Este serviço permite aos usuários armazenar, gerenciar e acessar seus dados de forma segura e eficiente.",
            "cgu.h1.3": "3. Utilização da API",
            "cgu.p.3": "A utilização da nossa API está sujeita às seguintes limitações:",
            "cgu.p.3.1": "Número máximo de modelos por utilizador: {{constant}} modelos.",
            "cgu.p.3.2": "Quantidade máxima de dados por modelo e por utilizador: {{constant}} registos.",
            "cgu.p.3.3": "Comprimento máximo das sequências de caracteres: caracteres {{constant}}.",
            "cgu.p.3.4": "Comprimento máximo da palavra-passe: caracteres {{constant}}.",
            "cgu.p.3.5": "Comprimento máximo dos textos enriquecidos: caracteres {{constant}}.",
            "cgu.p.3.6": "Quantidade máxima de dados por consulta: {{constant}} registos.",
            "cgu.p.3.7": "Quantidade máxima de dados por publicação: {{constant}} registos.",
            "cgu.p.3.8": "Número máximo de relações por dado: {{constant}} relações.",
            "cgu.p.3.9": "Taxa de dados: {{constante}} kb/s.",
            "cgu.h1.4": "4. Responsabilidades do Usuário",
            "cgu.p.4": "Ao utilizar o nosso serviço, você concorda em:\n\nRespeitar as limitações técnicas mencionadas acima.\nNão utilizar o nosso serviço para atividades ilegais ou não autorizadas.\nNão tentar contornar ou desativar as medidas de segurança do nosso serviço.\nNão compartilhar suas credenciais de login com terceiros.",
            "cgu.h1.5": "5. Propriedade Intelectual",
            "cgu.p.5": "Todo o conteúdo do Site, incluindo textos, imagens, gráficos, logotipos, ícones e softwares, é propriedade do Fornecedor ou de seus licenciadores e é protegido pelas leis de direitos autorais. Você não pode usar, reproduzir, distribuir ou modificar este conteúdo sem a nossa autorização prévia por escrito.",
            "cgu.h1.6": "6. Confidencialidade e Proteção de Dados",
            "cgu.p.6": "Estamos comprometidos em proteger seus dados pessoais de acordo com a nossa Política de Privacidade. Você é responsável pela segurança de suas credenciais de login e pela confidencialidade de seus dados.",
            "cgu.h1.7": "7. Limitação de Responsabilidade",
            "cgu.p.7": "O Fornecedor não será responsável por danos indiretos, incidentais, especiais ou consequentes resultantes do uso ou da impossibilidade de usar o nosso serviço, mesmo que tenhamos sido informados da possibilidade de tais danos.",
            "cgu.h1.8": "8. Modificações dos TCGU",
            "cgu.p.8": "Reservamo-nos o direito de modificar estes TCGU a qualquer momento. As modificações serão publicadas no Site e entrarão em vigor imediatamente. É sua responsabilidade consultar regularmente estes TCGU para se manter informado sobre quaisquer alterações.",
            "cgu.h1.9": "9. Rescisão",
            "cgu.p.9": "Reservamo-nos o direito de rescindir o seu acesso ao nosso serviço a qualquer momento, com ou sem motivo, e sem aviso prévio. Você também pode rescindir a sua conta a qualquer momento, seguindo as instruções disponíveis no Site.",
            "cgu.h1.10": "10. Lei Aplicável",
            "cgu.p.10": "Estes TCGU são regidos pelas leis em vigor na França. Qualquer litígio decorrente de ou relacionado com estes TCGU será submetido  jurisdição exclusiva dos tribunais competentes deste país.",
