            "cgu.h1": "Nutzungsbedingungen (TOU)",
            "cgu.h1.1": "1. Einleitung",
            "cgu.p.1": "Willkommen bei data.primals.net (der „Website“). Diese Website wird von Primals.net (dem „Anbieter“) betrieben. Durch die Nutzung unseres Datenhosting-Dienstes erklären Sie sich mit diesen Nutzungsbedingungen (TOU) einverstanden. Wenn Sie diesen Bedingungen nicht zustimmen, nutzen Sie unseren Dienst bitte nicht.",
            "cgu.h1.2": "2. Beschreibung des Dienstes",
            "cgu.p.2": "data.primals.net bietet einen Datenhosting-Dienst an, der eine Verwaltungsbenutzeroberfläche (UI) und eine API für Entwickler umfasst. Dieser Dienst ermöglicht es Benutzern, ihre Daten sicher und effizient zu speichern, zu verwalten und darauf zuzugreifen.",
            "cgu.h1.3": "3. Nutzung der API",
            "cgu.p.3": "Die Nutzung unserer API unterliegt den folgenden Einschränkungen:",
            "cgu.p.3.1": "Maximale Anzahl an Modellen pro Benutzer: {{constant}} Modelle.",
            "cgu.p.3.2": "Maximale Datenmenge pro Modell und pro Benutzer: {{constant}} Datensätze.",
            "cgu.p.3.3": "Maximale Länge der Zeichenfolgen: {{constant}} Zeichen.",
            "cgu.p.3.4": "Maximale Passwortlänge: {{constant}} Zeichen.",
            "cgu.p.3.5": "Maximale Länge angereicherter Texte: {{constant}} Zeichen.",
            "cgu.p.3.6": "Maximale Datenmenge pro Abfrage: {{constant}} Datensätze.",
            "cgu.p.3.7": "Maximale Datenmenge pro Veröffentlichung: {{constant}} Datensätze.",
            "cgu.p.3.8": "Maximale Anzahl von Beziehungen pro Daten: {{constant}} Beziehungen.",
            "cgu.p.3.9": "Datenrate: {{constant}} kb/s.","cgu.h1.4": "4. Verantwortlichkeiten des Benutzers",
            "cgu.p.4": "Durch die Nutzung unseres Dienstes erklären Sie sich mit Folgendem einverstanden:\n\nDie oben genannten technischen Einschränkungen zu beachten.\nUnseren Dienst nicht für illegale oder nicht autorisierte Aktivitäten zu nutzen.\nNicht zu versuchen, die Sicherheitsmaßnahmen unseres Dienstes zu umgehen oder zu deaktivieren.\nIhre Zugangsdaten nicht an Dritte weiterzugeben.",
            "cgu.h1.5": "5. Geistiges Eigentum",
            "cgu.p.5": "Alle Inhalte der Website, einschließlich Text, Bilder, Grafiken, Logos, Icons und Software, sind Eigentum des Anbieters oder seiner Lizenzgeber und durch Urheberrechtsgesetze geschützt. Sie dürfen diese Inhalte ohne unsere vorherige schriftliche Genehmigung weder verwenden, reproduzieren, verbreiten noch verändern.",
            "cgu.h1.6": "6. Vertraulichkeit und Datenschutz",
            "cgu.p.6": "Wir verpflichten uns, Ihre persönlichen Daten gemunserer Datenschutzrichtlinie zu schützen. Sie sind für die Sicherheit Ihrer Zugangsdaten und die Vertraulichkeit Ihrer Daten verantwortlich.",
            "cgu.h1.7": "7. Haftungsbeschränkung",
            "cgu.p.7": "Der Anbieter haftet nicht für indirekte, zufällige, besondere oder Folgeschäden, die aus der Nutzung oder der Unmöglichkeit der Nutzung unseres Dienstes entstehen, selbst wenn wir auf die Möglichkeit solcher Schäden hingewiesen wurden.",
            "cgu.h1.8": "8. Änderungen der Nutzungsbedingungen",
            "cgu.p.8": "Wir behalten uns das Recht vor, diese Nutzungsbedingungen jederzeit zu ändern. Änderungen werden auf der Website veröffentlicht und treten sofort in Kraft. Es liegt in Ihrer Verantwortung, diese Nutzungsbedingungen regelmäßig zu konsultieren, um sich über etwaige Änderungen zu informieren.",
            "cgu.h1.9": "9. Kündigung",
            "cgu.p.9": "Wir behalten uns das Recht vor, Ihren Zugang zu unserem Dienst jederzeit, mit oder ohne Grund und ohne Vorankündigung zu beenden. Sie können Ihr Konto auch jederzeit kündigen, indem Sie den auf der Website verfügbaren Anweisungen folgen.",
            "cgu.h1.10": "10. Geltendes Recht",
            "cgu.p.10": "Diese Nutzungsbedingungen unterliegen den in Frankreich geltenden Gesetzen. Alle Streitigkeiten, die sich aus oder im Zusammenhang mit diesen Nutzungsbedingungen ergeben, unterliegen der ausschließlichen Zuständigkeit der zuständigen Gerichte dieses Landes.",

