            "cgu.h1": "Termini di Utilizzo (TOU)",
            "cgu.h1.1": "1. Introduzione",
            "cgu.p.1": "Benvenuti su data.primals.net (il \"Sito\"). Questo sito è gestito da Primals.net (il \"Fornitore\"). Utilizzando il nostro servizio di hosting dati, accettate di rispettare i presenti Termini di Utilizzo (TOU). Se non accettate questi termini, vi preghiamo di non utilizzare il nostro servizio.",
            "cgu.h1.2": "2. Descrizione del Servizio",
            "cgu.p.2": "data.primals.net offre un servizio di hosting dati che include un'interfaccia utente (UI) di gestione e un'API per gli sviluppatori. Questo servizio consente agli utenti di archiviare, gestire e accedere ai propri dati in modo sicuro ed efficiente.",
            "cgu.h1.3": "3. Utilizzo dell'API",
            "cgu.p.3": "L'utilizzo della nostra API è soggetto alle seguenti limitazioni:",
            "cgu.p.3.1": "Numero massimo di modelli per utente: {{constant}} modelli.",
            "cgu.p.3.2": "Quantità massima di dati per modello e per utente: {{constant}} record.",
            "cgu.p.3.3": "Lunghezza massima delle stringhe di caratteri: {{constante}} caratteri.",
            "cgu.p.3.4": "Lunghezza massima della password: {{constante}} caratteri.",
            "cgu.p.3.5": "Lunghezza massima dei testi arricchiti: {{constant}} caratteri.",
            "cgu.p.3.6": "Quantità massima di dati per query: {{constante}} record.",
            "cgu.p.3.7": "Quantità massima di dati per pubblicazione: {{constant}} record.",
            "cgu.p.3.8": "Numero massimo di relazioni per dati: {{constante}} relazioni.",
            "cgu.p.3.9": "Velocità dati: {{constante}} kb/s.",
            "cgu.h1.4": "4. Responsabilità dell'Utente",
            "cgu.p.4": "Utilizzando il nostro servizio, accettate di:\n\nRispetta le limitazioni tecniche sopra menzionate.\nNon utilizzare il nostro servizio per attività illegali o non autorizzate.\nNon tentare di aggirare o disabilitare le misure di sicurezza del nostro servizio.\nNon condividere le proprie credenziali di accesso con terze parti.",
            "cgu.h1.5": "5. Proprietà Intellettuale",
            "cgu.p.5": "Tutti i contenuti del Sito, inclusi testi, immagini, grafici, loghi, icone e software, sono di proprietà del Fornitore o dei suoi licenziatari e sono protetti dalle leggi sul copyright. Non è consentito utilizzare, riprodurre, distribuire o modificare tali contenuti senza la nostra previa autorizzazione scritta.",
            "cgu.h1.6": "6. Riservatezza e Protezione dei Dati",
            "cgu.p.6": "Ci impegniamo a proteggere i vostri dati personali in conformità con la nostra Politica sulla Privacy. Siete responsabili della sicurezza delle vostre credenziali di accesso e della riservatezza dei vostri dati.",
            "cgu.h1.7": "7. Limitazione di Responsabilità",
            "cgu.p.7": "Il Fornitore non sarcidentali, speciali o consequenziali derivanti dall'uso o dall'impossibilità di utilizzare il nostro servizio, anche se siamo stati informati della possibilità di tali danni.",
            "cgu.h1.8": "8. Modifiche ai Termini di Utilizzo",
            "cgu.p.8": "Ci riserviamo il diritto di modificare i presenti Termini di Utilizzo in qualsiasi momento. Le modifiche saranno pubblicate sul Sito ed entreranno in vigore immediatamente. È vostra responsabilità consultare regolarmente i presenti Termini di Utilizzo per essere informati di eventuali modifiche.",
            "cgu.h1.9": "9. Risoluzione",
            "cgu.p.9": "Ci riserviamo il diritto di interrompere il vostro accesso al nostro servizio in qualsiasi momento, con o senza motivo e senza preavviso. Potete anche chiudere il vostro account in qualsiasi momento seguendo le istruzioni disponibili sul Sito.",
            "cgu.h1.10": "10. Legge Applicabile",
            "cgu.p.10": "I presenti Termini di Utilizzo sono regolati dalle leggi in vigore in Francia. Qualsiasi controversia derivante da o in relazione ai presenti Termini di Utilizzo sarà soggetta alla giurisdizione esclusiva dei tribunali competenti di tale paese.",
