            "cgu.h1": "Podmínky použití (TOU)",
            "cgu.h1.1": "1. Úvod",
            "cgu.p.1": "Vítejte na data.primals.net (dále jen \"Stránky\"). Tyto stránky provozuje Primals.net (\"Poskytovatel\"). Používáním naší služby hostování dat souhlasíte s dodržováním těchto Podmínek použití (TOU). Pokud s těmito podmínkami nesouhlasíte, nepoužívejte prosím naši službu.",
            "cgu.h1.2": "2. Popis služby",
            "cgu.p.2": "data.primals.net nabízí službu hostování dat, která zahrnuje uživatelské rozhraní pro správu (UI) a vývojářské API. Tato služba umožňuje uživatelům bezpečně a efektivně ukládat, spravovat a přistupovat k jejich datům.",
            "cgu.h1.3": "3. Použití rozhraní API",
            "cgu.p.3": "Použití našeho rozhraní API podléhá následujícím omezením:",
            "cgu.p.3.1": "Maximální počet modelů na uživatele: {{constant}} modelů.",
            "cgu.p.3.2": "Maximální množství dat na model a na uživatele: {{constant}} záznamů.",
            "cgu.p.3.3": "Maximální délka znakových řetězců: {{konstantní}} znaků.",
            "cgu.p.3.4": "Maximální délka hesla: {{konstantní}} znaků.",
            "cgu.p.3.5": "Maximální délka rozšířených textů: {{konstanta}} znaků.",
            "cgu.p.3.6": "Maximální množství dat na dotaz: {{konstantní}} mp. záznamů.",
            "cgu.p.3.7": "Maximální množství dat na publikaci: {{constant}} záznamů.",
            "cgu.p.3.8": "Maximální počet vztahů na data: {{konstantní}} vztahy.",
            "cgu.p.3.9": "Datová rychlost: {{konstantní}} kb/s.",
            "cgu.h1.4": "4. Povinnosti uživatele",
            "cgu.p.4": "Používáním naší služby souhlasíte s tím, že:\n\nDodržujete výše uvedená technická omezení.\nNebudete používat naši službu k nezákonným nebo neoprávněným činnostem.\nNepokoušejte se obcházet nebo deaktivovat bezpečnostní opatření naší služby.\nNesdílet své přihlašovací údaje s třetími stranami.",
            "cgu.h1.5": "5. Duševní vlastnictví",
            "cgu.p.5": "Veškerý obsah Stránek, včetně textů, obrázků, grafiky, log, ikon a softwaru, je majetkem Dodavatele nebo jeho poskytovatelů licencí a je chráněn autorským zákonem. Není dovoleno takový obsah používat, reprodukovat, distribuovat nebo upravovat bez našeho předchozího písemného souhlasu.",
            "cgu.h1.6": "6. Důvěrnost a ochrana údajů",
            "cgu.p.6": "Zavázali jsme se chránit vaše osobní údaje v souladu s našimi Zásadami ochrany osobních údajů. Jste odpovědní za bezpečnost svých přihlašovacích údajů a důvěrnost svých údajů.",
            "cgu.h1.7": "7. Omezení odpovědnosti",
            "cgu.p.7": "Dodavatel nenese odpovědnost za žádné škody, ať už zvláštní nebo následné, vyplývající z použití nebo nemožnosti využít naši službu, i když jsme byli na možnost takových škod upozorněni.",
            "cgu.h1.8": "8. Změny podmínek použití",
            "cgu.p.8": "Vyhrazujeme si právo tyto Podmínky použití kdykoli upravit. Změny budou zveřejněny na Stránkách a vstoupí v platnost okamžitě. Je vaší odpovědností pravidelně kontrolovat tyto Podmínky použití, abyste byli informováni o jakýchkoli změnách.",
            "cgu.h1.9": "9. Rozlišení",
            "cgu.p.9": "Vyhrazujeme si právo kdykoli ukončit váš přístup k naší službě, s udáním nebo bez něj a bez upozornění. Svůj účet můžete také kdykoli zrušit podle pokynů dostupných na Stránkách.",
            "cgu.h1.10": "10. Rozhodné právo",
            "cgu.p.10": "Tyto Podmínky použití se řídí zákony platnými ve Francii. Jakýkoli spor vzniklý z těchto podmínek použití nebo v souvislosti s nimi bude podléhat výlučné jurisdikci příslušných soudů dané země.",
            "seo.title": "Potřebujete výkonné a bezpečné řešení API, aniž byste zruinovali banku? Podívejte se na data.primals.net!",
