            "cgu.h1": "الشروط العامة للاستخدام (GTU)",
            "cgu.h1.1": "1. المقدمة",
            "cgu.p.1": "مرحبًا بك في data.primals.net (الموقع). يُدار هذا الموقع بواسطة Primals.net (المزود). باستخدامك خدمة استضافة البيانات لدينا, فإنك توافق على الالتزام بشروط الاستخدام العامة هذه. في حال عدم موافقتك على هذه الشروط، يُرجى عدم استخدام خدمتنا.",
            "cgu.h1.2": "2. وصف الخدمة",
            "cgu.p.2": "يقدم موقع data.primals.net خدمة استضافة بيانات تتضمن واجهة مستخدم للإدارة وواجهة برمجة تطبيقات للمطورين. تتيح هذه الخدمة للمستخدمين تخزين بياناتهم وإدارتها والوصول إليها بطريقة آمنة وفعالة.",
            "cgu.h1.3": "3. استخدام واجهة برمجة التطبيقات (API)",
            "cgu.p.3": "يخضع استخدام واجهة برمجة التطبيقات الخاصة بنا للقيود التالية:",
            "cgu.p.3.1": "الحد الأقصى لعدد النماذج لكل مستخدم: {{constant}} نماذج.",
            "cgu.p.3.2": "الحد الأقصى لكمية البيانات لكل نموذج ولكل مستخدم: {{constant}} سجل.",
            "cgu.p.3.3": "الحد الأقصى لطول سلاسل الأحرف: {{constant}} حرفًا.",
            "cgu.p.3.4": "الحد الأقصى لطول كلمة المرور: {{constant}} حرفًا.",
            "cgu.p.3.5": "الحد الأقصى لطول النصوص المُخصَّبة: {{constant}} حرفًا.",
            "cgu.p.3.6": "الحد الأقصى لكمية البيانات لكل استعلام: {{constant}} سجل.",
            "cgu.p.3.7": "الحد الأقصى لكمية البيانات لكل منشور: {{constant}} سجل.",
            "cgu.p.3.8": "الحد الأقصى لعدد العلاقات لكل بيانات: {{constant}} علاقات.",
            "cgu.p.3.9": "معدل البيانات: {{ثابت}} كيلو بايت/ثانية.",
            "cgu.h1.4": "4. مسؤوليات المستخدم",
            "cgu.p.4": "باستخدام خدمتنا، فإنك توافق على:\n\nاحترام القيود التقنية المذكورة أعلاه.\nعدم استخدام خدمتنا في أنشطة غير قانونية أو غير مصرح بها.\nعدم محاولة تجاوز أو تعطيل إجراءات الأمان الخاصة بخدمتنا.\nعدم مشاركة بيانات تسجيل الدخول الخاصة بك مع جهات أخرى.",
            "cgu.h1.5": "5. الملكية الفكرية",
            "cgu.p.5": "جميع محتويات الموقع، بما في ذلك النصوص والصور والرسومات والشعارات والأيقونات والبرامج، هي ملك للناشر أو الجهات المرخصة له، وهي محمية بموجب قوانين حقوق النشر. لا يجوز لك استخدام هذا المحتوى أو إعادة إنتاجه أو توزيعه أو تعديله دون الحصول على إذن كتابي مسبق منا.",
            "cgu.h1.6": "6. سرية المعلومات وحمايتها",
            "cgu.p.6": "نلتزم بحماية بياناتك الشخصية وفقًا لسياسة الخصوصية الخاصة بنا. أنت مسؤول عن أمان بيانات تسجيل الدخول وسرية بياناتك.",
            "cgu.h1.7": "7. تحديد المسؤولية",
            "cgu.p.7": "لن يكون المورد مسؤولاً عن الأضرار غير المباشرة أو العرضية أو الخاصة أو التبعية الناتجة عن استخدام خدمتنا أو عدم القدرة على استخدامها، حتى لو تم إبلاغنا بإمكانية حدوث مثل هذه الأضرار.",
            "cgu.h1.8": "8. تعديلات على الشروط والأحكام",
            "cgu.p.8": "نحتفظ بالحق في تعديل هذه الشروط والأحكام العامة في أي وقت. سيتم نشر أي تعديلات على الموقع وتدخل حيز التنفيذ فورًا. تقع على عاتقك مسؤولية مراجعة هذه الشروط والأحكام بعناية لإبقائك على اطلاع بأي تغييرات.",
            "cgu.h1.9": "9. المرونة",
            "cgu.p.9": "نحتفظ بالحق في إلغاء وصولك إلى خدمتنا في أي وقت، مع أو بدون سبب، ودون إشعار. يمكنك أيضًا إلغاء حسابك في أي وقت باتباع التعليمات المتوفرة على الموقع.",
            "cgu.h1.10": "10. القوانين المطبقة",
            "cgu.p.10": "تخضع هذه الشروط والأحكام العامة للقوانين السارية في فرنسا. أي نزاع ينشأ عن هذه الشروط والأحكام أو يتعلق بها يخضع للاختصاص الحصري للمحاكم المختصة في ذلك البلد.",
