            "cgu.h1": "Användarvillkor (Användarvillkor)",
            "cgu.h1.1": "1. Introduktion",
            "cgu.p.1": "Välkommen till data.primals.net (\"Sajten\"). Denna webbplats drivs av Primals.net (\"Leverantören\"). Genom att använda vår datavärdtjänst samtycker du till att följa dessa Användarvillkor (TOU). Om du inte godkänner dessa villkor, använd inte vår tjänst.",
            "cgu.h1.2": "2. Beskrivning av tjänsten",
            "cgu.p.2": "data.primals.net erbjuder en datavärdtjänst som inkluderar ett användargränssnitt för hantering (UI) och ett utvecklar-API. Denna tjänst tillåter användare att lagra, hantera och komma åt sina data säkert och effektivt.",
            "cgu.h1.3": "3. Använda API",
            "cgu.p.3": "Användningen av vårt API är föremål för följande begränsningar:",
            "cgu.p.3.1": "Maximalt antal mallar per användare: {{constant}} mallar.",
            "cgu.p.3.2": "Maximal mängd data per modell och per användare: {{constant}} poster.",
            "cgu.p.3.3": "Maximal längd på teckensträngar: {{constant}} tecken.",
            "cgu.p.3.4": "Maximal lösenordslängd: {{constant}} tecken.",
            "cgu.p.3.5": "Maximal längd på formaterade texter: {{constant}} tecken.",
            "cgu.p.3.6": "Maximal mängd data per begäran: {{constant}} poster.",
            "cgu.p.3.7": "Maximal mängd data per datamängd: {{constant}} relationer.",
            "cgu.p.3.9": "Dataöverföringshastighet: {{constant}} kb/s.",
            "cgu.h1.4": "4. Användaransvar",
            "cgu.p.4": "Genom att använda vår tjänst samtycker du till att:\n\nFölja de tekniska begränsningarna som nämns ovan.\nInte använda vår tjänst för olagliga eller obehöriga aktiviteter.\nInte försöka kringgå eller inaktivera säkerhetsåtgärderna för vår tjänst.\nInte dela dina inloggningsuppgifter med tredje part.",
            "cgu.h1.5": "5. Immateriella rättigheter",
            "cgu.p.5": "Allt innehåll på webbplatsen, inklusive texter, bilder, grafik, logotyper, ikoner och programvara, tillhör leverantören eller dess licensgivare och skyddas av upphovsrättslagar. Det är inte tillåtet att använda, reproducera, distribuera eller modifiera sådant innehåll utan vårt skriftliga tillstånd i förväg.",
            "cgu.h1.6": "6. Sekretess och dataskydd",
            "cgu.p.6": "Vi har åtagit oss att skydda dina personuppgifter i enlighet med vår integritetspolicy. Du är ansvarig för säkerheten för dina inloggningsuppgifter och sekretessen för dina uppgifter.",
            "cgu.h1.7": "7. Ansvarsbegränsning",
            "cgu.p.7": "Leverantören är inte ansvarig för några skador, vare sig de är speciella eller följdskador, som uppstår till följd av användningen eller oförmågan att använda vår tjänst, även om vi har informerats om möjligheten till sådana skador.",
            "cgu.h1.8": "8. Ändringar av användarvillkoren",
            "cgu.p.8": "Vi förbehåller oss rätten att när som helst ändra dessa användarvillkor. Ändringar kommer att publiceras på webbplatsen och träder i kraft omedelbart. Det är ditt ansvar att regelbundet granska dessa användarvillkor för att bli informerad om eventuella ändringar.",
            "cgu.h1.9": "9. Upplösning",
            "cgu.p.9": "Vi förbehåller oss rätten att avsluta din åtkomst till vår tjänst när som helst, med eller utan orsak och utan förvarning. Du kan också stänga ditt konto när som helst genom att följa instruktionerna som finns på webbplatsen.",
            "cgu.h1.10": "10. Tillämplig lag",
            "cgu.p.10": "Dessa användarvillkor regleras av lagarna som gäller i Frankrike. Alla tvister som uppstår ur eller i samband med dessa användarvillkor ska vara föremål för exklusiv jurisdiktion för de behöriga domstolarna i det landet.",
            "seo.title": "Behöver du en kraftfull och säker API-lösning utan att bryta banken? Kolla in data.primals.net!",
