            "cgu.p.3.9": "Διακίνηση δεδομένων: {{constant}} kbps.",
            "cgu.h1.4": "4. Ευθύνες χρήστη",
            "cgu.p.4": "Χρησιμοποιώντας την υπηρεσία μας, συμφωνείτε να:\n\nΣέβεστε τους τεχνικούς περιορισμούς που αναφέρονται παραπάνω.\nΜην χρησιμοποιείτε την υπηρεσία μας για παράνομες ή μη εξουσιοδοτημένες δραστηριότητες.\nΜην επιχειρήσετε να παρακάμψετε ή να απενεργοποιήσετε τα μέτρα ασφαλείας της υπηρεσίας μας.\nΜην κοινοποιείτε τα διαπιστευτήρια σύνδεσής σας με άλλα επίπεδα.",
            "cgu.h1.5": "5. Πνευματική Ιδιοκτησία",
            "cgu.p.5": "Όλο το περιεχόμενο στον Ιστότοπο, συμπεριλαμβανομένων κειμένων, εικόνων, γραφικών, λογότυπων, εικονιδίων και λογισμικού, είναι ιδιοκτησία του Εκδότη ή των δικαιοπαρόχων του και προστατεύεται από νόμους περί πνευματικών δικαιωμάτων. Δεν μπορείτε να χρησιμοποιήσετε, να αναπαράγετε, να διανείμετε ή να τροποποιήσετε αυτό το περιεχόμενο χωρίς την προηγούμενη γραπτή μας εξουσιοδότηση.",
            "cgu.h1.6": "6. Εμπιστευτικότητα και προστασία των πληροφοριών",
            "cgu.p.6": "Αναλαμβάνουμε την υποχρέωση να προστατεύσουμε τα προσωπικά σας δεδομένα σύμφωνα με την Πολιτική Απορρήτου μας. Είστε υπεύθυνοι για την ασφάλεια των στοιχείων σύνδεσής σας και την εμπιστευτικότητα των δεδομένων σας.",
            "cgu.h1.7": "7. Περιορισμός ευθύνης",
            "cgu.p.7": "Ο Προμηθευτής δεν ευθύνεται για έμμεσες, τυχαίες, ειδικές ή αποθετικές ζημιές που προκύπτουν από τη χρήση ή την αδυναμία χρήσης της υπηρεσίας μας, ακόμη και αν ενημερωθήκαμε για την πιθανότητα τέτοιων ζημιών.",
            "cgu.h1.8": "8. Τροποποιήσεις στους Όρους και Προϋποθέσεις",
            "cgu.p.8": "Διατηρούμε το δικαίωμα να τροποποιήσουμε αυτούς τους ΓΟΠ ανά πάσα στιγμή. Τυχόν τροποποιήσεις θα δημοσιευτούν στον Ιστότοπο και θα τεθούν σε ισχύ αμέσως. Είναι δική σας ευθύνη να συμβουλευτείτε προσεκτικά αυτούς τους ΓΟΠ για να σας ενημερώνουμε για τυχόν αλλαγές.",
            "cgu.h1.9": "9. Ανθεκτικότητα",
            "cgu.p.9": "Διατηρούμε το δικαίωμα να ακυρώσουμε την πρόσβασή σας στην υπηρεσία μας ανά πάσα στιγμή, με ή χωρίς λόγο και χωρίς προειδοποίηση. Μπορείτε επίσης να ακυρώσετε τον λογαριασμό σας ανά πάσα στιγμή ακολουθώντας τις οδηγίες που είναι διαθέσιμες στον Ιστότοπο.",
            "cgu.h1.10": "10. Ισχύοντες νόμοι",
            "cgu.p.10": "Αυτοί οι ΓΟΠ διέπονται από τους νόμους που ισχύουν στη Γαλλία. Οποιαδήποτε διαφορά προκύψει από ή σε σχέση με αυτούς τους ΓΟΠ υπόκειται στην αποκλειστική δικαιοδοσία των αρμόδιων δικαστηρίων αυτής της χώρας.",
            "seo.title": "Χρειάζεστε μια ισχυρή και ασφαλή λύση API, χωρίς να ξοδέψετε τα χρήματα; Ρίξτε μια ματιά στο data.primals.net!",
