            "cgu.h1.3": "3. استفاده از API",
            "cgu.p.1": "به data.primals.net خوش آمدید. این سایت توسط Primals.net اداره می‌شود. با استفاده از سرویس میزبانی داده ما، شما موافقت می‌کنید که به این شرایط عمومی استفاده (CGU) پایبند باشید. اگر این شرایط را نمی‌پذیرید، لطفاً از سرویس ما استفاده نکنید.",
            "cgu.p.2": "data.primals.net یک سرویس میزبانی داده ارائه می‌دهد که شامل یک رابط کاربری (UI) مدیریت و یک API برای توسعه‌دهندگان است. این سرویس به کاربران امکان می‌دهد داده‌های خود را به روشی امن و کارآمد ذخیره، مدیریت و دسترسی داشته باشند.",
            "cgu.p.3": "استفاده از API ما مشمول محدودیت‌های زیر است:",
            "cgu.p.3.1": "حداکثر تعداد مدل‌ها برای هر کاربر: {{constant}} مدل.",
            "cgu.p.3.2": "حداکثر مقدار داده برای هر مدل و هر کاربر: {{constant}} رکورد.",
            "cgu.p.3.3": "حداکثر طول رشته‌های کاراکتر: {{constant}} کاراکتر.",
            "cgu.p.3.4": "حداکثر طول رمز عبور: {{constant}} کاراکتر.",
            "cgu.p.3.5": "حداکثر طول متن‌های غنی: {{constant}} کاراکتر.",
            "cgu.p.3.6": "حداکثر مقدار داده در هر درخواست: {{constant}} رکورد.",
            "cgu.p.3.7": "حداکثر مقدار داده در هر انتشار: {{constant}} رکورد.",
            "cgu.p.3.8": "حداکثر تعداد روابط برای هر داده: {{constant}} رابطه.",
            "cgu.p.3.9": "نرخ انتقال داده: {{constant}} kb/s.",
            "cgu.h1.4": "4. مسئولیت‌های کاربر",
            "cgu.p.4": "با استفاده از سرویس ما، شما موافقت می‌کنید که:\n\nمحدودیت‌های فنی ذکر شده در بالا را رعایت کنید.\nاز سرویس ما برای فعالیت‌های غیرقانونی یا غیرمجاز استفاده نکنید.\nسعی نکنید اقدامات امنیتی سرویس ما را دور بزنید یا غیرفعال کنید.\nاطلاعات ورود خود را با اشخاص ثالث به اشتراک نگذارید.",
            "cgu.h1.5": "5. مالکیت معنوی",
            "cgu.p.5": "تمام محتوای سایت، از جمله متن‌ها، تصاویر، نمودارها، لوگوها، آیکون‌ها و نرم‌افزار، متعلق به ارائه‌دهنده یا دارندگان مجوز آن است و تحت قوانین حق چاپ محافظت می‌شود. شما نمی‌توانید بدون اجازه کتبی قبلی ما از این محتوا استفاده، تکثیر، توزیع یا تغییر دهید.",
            "cgu.h1.6": "6. محرمانگی و حفاظت از داده‌ها",
            "cgu.p.6": "ما متعهد به محافظت از داده‌های شخصی شما مطابق با سیاست حفظ حریم خصوصی خود هستیم. شما مسئول امنیت اطلاعات ورود خود و محرمانگی داده‌های خود هستید.",
            "cgu.h1.7": "7. محدودیت مسئولیت",
            "cgu.p.7": "ارائه‌دهنده مسئول خسارات غیرمستقیم، اتفاقی، خاص یا پیامد ناشی از استفاده یا عدم توانایی در استفاده از سرویس ما نخواهد بود، حتی اگر از احتمال چنین خساراتی مطلع شده باشیم.",
            "cgu.h1.8": "8. تغییرات CGU",
            "cgu.p.8": "ما حق داریم این CGU را در هر زمان تغییر دهیم. تغییرات در سایت منتشر می‌شوند و بلافاصله اثر می‌گذارند. این مسئولیت شماست که به طور منظم این CGU را بررسی کنید تا از هرگونه تغییر مطلع شوید.",
            "cgu.h1.9": "9. فسخ",
            "cgu.p.9": "ما حق داریم دسترسی شما به سرویس خود را در هر زمان، با یا بدون دلیل، و بدون اطلاع قبلی فسخ کنیم. شما همچنین می‌توانید حساب خود را در هر زمان با دنبال کردن دستورالعمل‌های موجود در سایت فسخ کنید.",
            "cgu.h1.10": "10. قانون حاکم",
            "cgu.p.10": "این CGU تابع قوانین فعلی فرانسه است. هرگونه اختلاف ناشی از یا مربوط به این CGU منحصراً در صلاحیت دادگاه‌های صالح این کشور خواهد بود.",
            "seo.title": "نیاز به یک راه‌حل API قدرتمند و امن دارید، بدون هزینه گزاف؟ data.primals.net را کشف کنید!",
